B.JP=new A.bl("i was driving back home around 5pm the other day, and as i was trying to enter my apartment parking lot, i was struggling as per usual. at the entrance, there's this residents-only parking pass (magnet-ish thingie) that i have to wave at a machine in order for it to successfully recognize my parking pass, sort of like a sensor. for some reason, the sensor never functions successfully on the first try most of the time, which i've gotten used to.",null,null,B.r,null)
