B.JA=new A.bl("this time, it was different - it took almost two minutes and the gate was still not open. it is not unexpected, as there is always tail-risk to a binomial distribution, and if i\u2019m living in this apartment complex for the third year, it is about time i get an instance of me waving my parking pass way more than ten times.",null,null,B.r,null)
