B.JM=new A.bl("as i was pulling back my car, the maintenance staff member pulled up with his car exiting the parking lot (there is one barricade for going in and another for going out of the parking lot). he was probably going home after his work day. he pulled down his window and said, \u201chey man is it not working again?\u201d",null,null,B.r,null)
B.JC=new A.bl("so i pulled down my window and said, \u201chey yeah it\u2019s not this bad usually but man it\u2019s just dead today\u201d",null,null,B.r,null)
B.Jz=new A.bl("he responded, \u201cyeah man that\u2019s why when i\u2019m at work i just pull the barricade up and turn it off because it is so bad, keep practicing though, you\u2019ll get better at it you have a good night\u201d",null,null,B.r,null)
B.Jn=new A.bl("his response gave me what is perhaps one of the most obvious, boring realizations, nonetheless a big one for me.",null,null,B.r,null)
B.Jt=new A.bl("i\u2019ve always thought that it is the sensor, the object, that has a perpetually fixed, low p parameter value (\u201csuccess rate\u201d), but his notion that if you practice you\u2019ll somehow \u201cget better at it\u201d prompted me to re-define the framework \u2014 the sensor does not necessarily have to have a perpetually fixed, low p parameter value, but really, each individual has their own p (success rate)!",null,null,B.r,null)
B.JS=new A.bl("what if it\u2019s the other way? what if it truly is each individual having their distinct success rates due to difference in \u201cwaving skill\u201d, strength of magnet in parking pass, or for whatever reason?",null,null,B.r,null)
B.Jp=new A.bl("i truly had not thought of it that way. i was very comfortable in my head to think and conclude from the very beginning that the sensor was just a very bad one with a low success rate, but it very much could be that every individual has their unique p (\u201csuccess rate\u201d), which completely overthrows my previous belief of \u201cthe sensor is bad, it is what it is\u201d and imbues this new belief of \u201ci do not know if the sensor is good or bad, but whether it takes 30 seconds or 90 seconds is up to me\u201d",null,null,B.r,null)
B.Jo=new A.bl("sure, in reality, it is probably a combination of both how good the sensor is and how good an individual\u2019s \u201cwaving skill/angle\u201d is, but his short response made me think about how many things in daily life i had previously assigned an external p (\u201csuccess rate\u201d) that i do not have control over. ",null,null,B.r,null)
B.JQ=new A.bl("assigning external p\u2019s on many things in daily life (parking barricade, Amazon Alexa hearing me when i say \u201cAlexa\u201d, trivial things like that) is sure comforting for me, but assigning an internal p, which i have the power to increase over time with, say, practice, was oddly an obvious, yet empowering notion he gave me in that very brief moment.",null,null,B.r,null)
B.Jw=new A.bl("in that preconceived notion of geometric distribution where X = k+1 such that k is the number of failures until my first success, i can employ a mental model where i can start believing that \u201cp\u201d is up to me, and not up to \u201cworld\u201d. that clearly means that, in that case, i have the power to skew the underlying distribution!",null,null,B.r,null)
B.JR=new A.bl("it is a massively trivial situation and a massively trivial, non-riveting-to-some realization i had that day, but it made me think about how many more distributions in daily life (and perhaps in broader \u201clife\u201d) i can start owning and claim (whether it is true or not) that the parameters rather than letting \u201cworld\u201d decide the parameter values.",null,null,B.r,null)
B.JJ=new A.bl("it was very cool of him to give me that moment of \u201cit is up to you if you believe it\u201d that day at the parking lot entrance. i ended up getting frustrated and still drove to the other gate and got back home that way, but still, it made me want to stop understanding and accepting certain distributions in life and mentally \u201cclaim/own\u201d it.",null,null,B.r,null)
B.Jq=new A.bl("i\u2019ll probably remember that moment for a very long time, but i had to write it down here because i did not want to forget.",null,null,B.r,null)
