B.Jr=new A.bl(" is, as of now, a webapp that helps college students find roommates, off-campus sublease properties, or sublease tenants, only available to anyone with a valid Duke Net ID. ",null,null,B.r,null)
B.Js=new A.bl("in the end, we got super lucky and won 1st place in the Education Track for HackDuke (Code for Good 2023)!\n",null,null,B.r,null)
B.Ju=new A.bl("overall, it was an amazing experience. my main role was an engineer/pm hybrid, assisting the two main engineers in frontend development, creating custom functions in the backend (simple data structure massaging to save time for the main engineers), and bridging my girlfriend's designs with development.",null,null,B.r,null)
B.Jv=new A.bl("after 36 hours of hacking, i felt that i got a lot more comfortable with TypeScript as i learned a lot from the main engineers, and i've never coded under a time pressure like that so that was a good learning experiene",null,null,B.r,null)
B.Jx=new A.bl("after a year of on-and-off cycles of building (and resting), with Bean, the team was able to get to be part of Duke Innovation Studio's Spring '23 Cohort and eventually mvp-launched to the Duke community in april-2023, gain a couple hundred users, got meaningful insights, further ideas to work on.",null,null,B.r,null)
B.Jy=new A.bl(" is an independent label i co-run with one of my best friends. we're hoping to grow it into a family of independent artists (musicians, poets, painters, etc.) that come together to insprie each other and take turns fundraising from fans for a cause, using artistry as a means.",null,null,B.r,null)
B.L4=new A.u(!0,null,null,null,null,null,null,null,B.ne,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.JD=new A.bl("right",null,null,B.r,B.L4)
B.JE=new A.bl('the name of the label, long story short, comes down to how amazing (to the n-th degree) of a human being Clouds in Seoul (the guy im co-running the label) is. as someone who has been exposed to his stories and music for as long as i can remember, i truly began to realize the power of "good people attracting to good people", art and music aside.',null,null,B.r,null)
B.JG=new A.bl("as of now, the service is not active, but i hope to grow this at some point into something useful, if not a fully-launched product.",null,null,B.r,null)
B.JH=new A.bl(" is an AI-supported tool (marrying GPT3.5 and DeepL) that helps non-native English speakers learn to code, from learning simple syntax to debugging.",null,null,B.r,null)
B.JI=new A.bl("\n",null,null,B.r,null)
B.JK=new A.bl("i had come back to campus for my senior year a week-ish late, and my girlfriend wanted me to do a hackathon with her. she said she's worked with these twin engineers (then-sophomores at duke) who are great and us four together would make a great team. i was so so exhausted from catching up with school work and just wanted to \"chill\", but i gave it a go since it's only a weekend-long hackathon.",null,null,B.r,null)
B.JL=new A.bl("songwriting is super fun for me, and i hope to continue working on this for quite a while!",null,null,B.r,null)
B.JN=new A.bl('i was bored sophomore year and wanted to make a "tinder for guessing market events" for one reason or another (if i recall, one of the reasons was that i simply did not have the skills), the team ended up building a webapp that helps people optimize their co-living experience on campus, off campus, during summer internship, etc. the idea came about when i was stuck (again due to lack of my capabilities) and the designer on the team (my girlfriend) floated the idea of a roommate-matching platform. i liked the idea mostly because i could tell building it would teach me so many things i had been wanting to learn abt, but i also did zoom out and realized how much a struggle-topic co-living is to college students.',null,null,B.r,null)
